import './App.css';
import {BrowserRouter, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar'
import React from 'react';
import Home from './components/pages/Home';

function App() {
  return (
    <>
    <BrowserRouter>
      <Routes>
        <Route exact path='/' element={<Home/>} component={Home}/>
      </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
